<?php
/*
Plugin Name: WooCommerce New Order Popup
Description: Displays a full-screen popup with sound for new WooCommerce orders. Supports HPOS.
Version: 1.0
Author: Muhammad Omman
*/


if (!defined('ABSPATH')) {
    exit; // Exit if accessed directly
}

// Check if WooCommerce is active
if (in_array('woocommerce/woocommerce.php', apply_filters('active_plugins', get_option('active_plugins')))) {

    // Enqueue scripts and styles
    function wc_new_order_popup_enqueue_scripts() {
        wp_enqueue_script('wc-new-order-popup-js', plugin_dir_url(__FILE__) . 'assets/js/script.js', array('jquery'), '1.0', true);
        wp_enqueue_style('wc-new-order-popup-css', plugin_dir_url(__FILE__) . 'assets/css/style.css', array(), '1.0');
        wp_localize_script('wc-new-order-popup-js', 'wc_new_order_popup_params', array(
            'ajax_url' => admin_url('admin-ajax.php'),
            'sound_base64' => get_option('wc_new_order_popup_sound_base64', 'data:audio/mpeg;base64,'), // Default or custom sound
            'admin_url' => admin_url(),
        ));
    }
    add_action('admin_enqueue_scripts', 'wc_new_order_popup_enqueue_scripts');

    // Add a settings page to the WordPress admin
    function wc_new_order_popup_settings_page() {
        add_menu_page(
            'New Order Popup Settings', // Page title
            'Order Popup',              // Menu title
            'manage_options',           // Capability required
            'wc-new-order-popup',       // Menu slug
            'wc_new_order_popup_settings_page_html', // Callback function
            'dashicons-bell',           // Icon
            100                         // Position
        );
    }
    add_action('admin_menu', 'wc_new_order_popup_settings_page');

    // HTML for the settings page
    function wc_new_order_popup_settings_page_html() {
        // Check user capabilities
        if (!current_user_can('manage_options')) {
            return;
        }

        // Save settings if form is submitted
        if (isset($_POST['wc_new_order_popup_settings_nonce'])) {
            if (!wp_verify_nonce($_POST['wc_new_order_popup_settings_nonce'], 'wc_new_order_popup_settings')) {
                return;
            }

            // Save settings
            update_option('wc_new_order_popup_enabled', isset($_POST['wc_new_order_popup_enabled']) ? 1 : 0);
            update_option('wc_new_order_popup_roles', isset($_POST['wc_new_order_popup_roles']) ? $_POST['wc_new_order_popup_roles'] : array());
            update_option('wc_new_order_popup_sound_base64', sanitize_text_field($_POST['wc_new_order_popup_sound_base64']));
        }

        // Get saved settings
        $enabled = get_option('wc_new_order_popup_enabled', 1);
        $selected_roles = get_option('wc_new_order_popup_roles', array('administrator', 'shop_manager'));
        $sound_base64 = get_option('wc_new_order_popup_sound_base64', '');

        // Get all user roles
        global $wp_roles;
        $roles = $wp_roles->get_names();

        ?>
        <div class="wrap">
            <h1>New Order Popup Settings</h1>
            <form method="post" action="">
                <?php wp_nonce_field('wc_new_order_popup_settings', 'wc_new_order_popup_settings_nonce'); ?>
                <table class="form-table">
                    <tr>
                        <th scope="row">Enable Popup and Sound</th>
                        <td>
                            <label for="wc_new_order_popup_enabled">
                                <input type="checkbox" name="wc_new_order_popup_enabled" id="wc_new_order_popup_enabled" value="1" <?php checked($enabled, 1); ?>>
                                Enable notifications
                            </label>
                        </td>
                    </tr>
                    <tr>
                        <th scope="row">User Roles</th>
                        <td>
                            <?php foreach ($roles as $role_slug => $role_name) : ?>
                                <label>
                                    <input type="checkbox" name="wc_new_order_popup_roles[]" value="<?php echo esc_attr($role_slug); ?>" <?php checked(in_array($role_slug, $selected_roles)); ?>>
                                    <?php echo esc_html($role_name); ?>
                                </label><br>
                            <?php endforeach; ?>
                        </td>
                    </tr>
                    <tr>
                        <th scope="row">Custom Sound (Base64)</th>
                        <td>
                            <textarea name="wc_new_order_popup_sound_base64" rows="5" cols="50"><?php echo esc_textarea($sound_base64); ?></textarea>
                            <p class="description">Paste a base64-encoded sound (e.g., data:audio/mpeg;base64,...).</p>
                        </td>
                    </tr>
                </table>
                <?php submit_button('Save Settings'); ?>
            </form>
        </div>
        <?php
    }

    // AJAX handler to check for new orders
    function wc_new_order_popup_check_orders() {
        // Check if notifications are enabled
        if (!get_option('wc_new_order_popup_enabled', 1)) {
            wp_send_json_error('Notifications are disabled.');
        }

        // Check user capabilities
        $allowed_roles = get_option('wc_new_order_popup_roles', array('administrator', 'shop_manager'));
        $user = wp_get_current_user();
        $has_access = false;

        foreach ($allowed_roles as $role) {
            if (in_array($role, $user->roles)) {
                $has_access = true;
                break;
            }
        }

        if (!$has_access) {
            wp_send_json_error('Unauthorized');
        }

        // Fetch new orders
        $last_checked = get_option('wc_new_order_popup_last_checked', 0);
        $args = array(
            'limit' => -1,
            'status' => array('processing', 'on-hold'),
            'date_created' => '>' . $last_checked,
        );

        $orders = wc_get_orders($args);
        $new_orders = array();

        foreach ($orders as $order) {
            $new_orders[] = array(
                'id' => $order->get_id(),
                'total' => $order->get_total(),
                'date' => $order->get_date_created()->date('Y-m-d H:i:s'),
            );
        }

        if (!empty($new_orders)) {
            update_option('wc_new_order_popup_last_checked', time());
        }

        wp_send_json_success($new_orders);
    }
    add_action('wp_ajax_wc_new_order_popup_check_orders', 'wc_new_order_popup_check_orders');

    // Add the popup HTML to the admin footer
    function wc_new_order_popup_html() {
        ?>
        <div id="wc-new-order-popup" style="display:none;">
            <div class="wc-new-order-popup-content">
                <h2>New Order Received!</h2>
                <ul id="wc-new-order-list"></ul>
                <button id="wc-new-order-close">Accept Orders</button>
            </div>
        </div>
        <?php
    }
    add_action('admin_footer', 'wc_new_order_popup_html');

    // Add HPOS support
    function wc_new_order_popup_hpos_support() {
        if (class_exists('Automattic\WooCommerce\Utilities\FeaturesUtil')) {
            \Automattic\WooCommerce\Utilities\FeaturesUtil::declare_compatibility('custom_order_tables', __FILE__, true);
        }
    }
    add_action('before_woocommerce_init', 'wc_new_order_popup_hpos_support');

}